import React from 'react'
import { Text, View } from "react-native";

const SignOnScreen = () => (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center'}}>
        <Text>SignOnScreen ###</Text>
    </View>
)

export default SignOnScreen;
